  [],\n\t\"revision_timestamp\": \"2016-07-15T04:24:52.195851\",\n\t\"name\": \"the-impact-of-hospital-acquired-conditions-on-medicare-fe70e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>According to findings reported in The
  Impact of Hospital-Acquired Conditions on Medicare Program Payments, published in
  Volume 4, Issue 4 of the Medicare and Medicaid Research Review, certain conditions
  or infections acquired by Medicare patients during hospital stays cost the Medicare
  program at least 146 dollars million per year more than the cost if these conditions
  or infections would have been prevented. These conditions including severe pressure
  ulcers, fractures, catheter-associated urinary tract infections, vascular catheter-associated
  infections, surgical site infections following certain spinal, shoulder, or elbow
  procedures, and deep vein thrombosis or pulmonary embolism following hip or knee
  replacements could reasonably have been prevented through the application of evidence-based
  guidelines. Improving care quality in hospitals to prevent these conditions has
  the potential to significantly reduce Medicare costs.</p>n\",\n\t\"license_title\":
